  true,\n\t\"url\": null,\n\t\"notes\": \"<p>This section contains statistical information
  and reports related to the percentage of electronic transactions being sent to Medicare
  contractors in the formats adopted as national standards under the Health Insurance
  Portability and Accountability Act of 1996 (HIPAA). Statistics have not yet been
  posted for the 276-277 claim status and response or the 270-271 eligibility query
  and response transactions, but those statistics should be added to this site soon.
  \ Please see pages on the 276-277 and the 270-271 in the Medicare Electronic Billing
  and Electronic Data Interchange (EDI) Transactions section of this Web site for
  further information on use of those transactions. There are also pages in that section
  on Medicare electronic claims, remittance advice, and coordination of benefit transactions
  for which statistics are included in this section of the Centers for Medicare and
  Medicaid Services (CMS) Web site.</p>n\",\n\t\"license_title\": \"Other License
